import React from 'react';
import './navBar.css';

function NavBar () {
  return (
    <div className='navBar'>
      <div className="left-side-nav">
        <button href=''>
          <img src='https://seguidores.online/wp-content/uploads/2019/08/dm-en-instagram.png'></img>
        </button>
        <a href=''>Rewrams</a>
      </div>
      <div className='right-side-nav'>
        <button>Channels</button>
        <button>About</button>
      </div>
    </div> 
  )
}

export default NavBar;
